    private static void bubbleSort(List<Integer> list) {
        boolean isSorted = false;
        int limit = list.size();

        while (!isSorted) {
            isSorted = true;
            for (int i = 0; i < limit - 1; i++) {
                if (list.get(i) > list.get(i + 1)) {
                    int temp = list.get(i);
                    list.set(i, list.get(i + 1));
                    list.set(i + 1, temp);
                    isSorted = false;
                }
            }
        }
    }

    private static void bubbleSortMovingLimit(List<Integer> list) {
        boolean isSorted = false;
        int limit = list.size();
        int newlimit = 0;

        while (!isSorted) {
            isSorted = true;
            for (int i = 0; i < limit - 1; i++) {
                if (list.get(i) > list.get(i + 1)) {
                    int temp = list.get(i);
                    list.set(i, list.get(i + 1));
                    list.set(i + 1, temp);
                    isSorted = false;
                    newlimit = i + 1;
                }
            }
            limit = newlimit;
            newlimit = 0;
        }
    }
